void loginPage(bool *status, string *username, string *password) {
  int i;

  for(i = 1; i <= 5; i++)
  {
    system("cls");
    printf("\t---===[ LOGIN ]===---\n");
    printf("\tMasukkan Username\t: ");
    fflush(stdin);gets(*username);
    printf("\tMasukkan Password\t: ");
    fflush(stdin);gets(*password);

    if (strcmp(*username, "besams") != 0 && strcmp(*password, "smaseb") != 0)
    {
      printf("\n\t[!] Username dan Password masih salah [!]");
    }
    else if (strcmp(*username, "besams") != 0)
    {
      printf("\n\t[!] Username masih salah [!]");
    }
    else if (strcmp(*password, "smaseb") != 0)
    {
      printf("\n\t[!] Password masih salah [!]");
    }
    else
    {
      *status = true;
      break;
    }

    getch();
    if(i == 3)
    {
      printf("\n\t[!] Anda sudah mencoba 3 kali, silahkan tunggu beberapa detik untuk mencoba lagi [!]");
      sleep(3);
